			label: pais.Name
		});
	}); */
/*
	const [hidden, sethidden] = useState({
		escondido: false
	});
	const [clas, useclas] = useState({
		datos: ''
	});
	const buscarhts = () => {
		sethidden({ escondido: true });
		useclas({ datos: guardarsku.shortdescription });
	}; */

	return (
		<div>
			<Paper sx={{padding: 3}}>
				<Typography variant="h5" gutterBottom >
					<strong>Perfil del Seller</strong>
				</Typography>
				<Typography style={{ textAlign: 'center' }}  gutterBottom>
					<Button startIcon={<Save />} size="small" variant="contained" color="secondary">
						Grabar Información
					</Button>
				</Typography>
				<br />
				<Divider />
				<br />
				<FormControl  variant="outlined">
					<TextField
						id="legalname"
						name="legalname"
						label="Legal Name"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.sku}
						// onChange={handlingChange}
					/>
					<Typography variant="caption" gutterBottom>
						Input Seller`s Legal Name
					</Typography>

					<TextField
						id="dbaname"
						name="dbaname"
						label="DBA Name"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.upc_number}
						// onChange={handlingChange}
					/>
					<Typography variant="caption" gutterBottom>
						Input DBA Name (Optional)
					</Typography>
					<TextField
						id="contacto"
						name="contacto"
						label="Contact Name"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.upc_number}
						// onChange={handlingChange}
					/>
					<Typography variant="caption" gutterBottom>
						Input Contact Name
					</Typography>
					<TextField
						id="email"
						name="email"
						label="email"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.upc_number}
						// onChange={handlingChange}
					/>
					<Typography variant="caption" gutterBottom>
						Input Contact Email
					</Typography>

					<TextField
						id="address"
						name="adress"
						label="Legal Address"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.fob}
						// onChange={handlingChange}
						/* InputProps={{
							startAdornment: <InputAdornment position="start">US$</InputAdornment>
						}} */
					/>
					<Typography variant="caption" gutterBottom>
						Legal Address (Number, Street, City)
					</Typography>

					<TextField
						id="estado"
						name="estado"
						label="State"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.shortdescription}
						// onChange={handlingChange}
					/>
					<Typography variant="caption" gutterBottom>
						Input Country's State
					</Typography>
					<TextField
						id="zipcode"
						name="zipcode"
						label="Zip Code"
						variant="outlined"
						color="primary"
						type="text"
						// value={guardarsku.shortdescription}
						// onChange={handlingChange}
					/>
					<Typography variant="caption" gutterBottom>
						Input Zip Code
					</Typography>

					<Select id="country_origin" name="country_origin"  />
					<Typography variant="caption" gutterBottom>
						Select Country
					</Typography>
				</FormControl>
			</Paper>

			<br />
		</div>
	);
}
